  final func removeEBObserverOf_packageZones (_ inObserver : EBEvent) {
    self.mObserversOf_packageZones.remove (inObserver)
    if let object = self.propval {
      object.packageZones_property.removeEBObserver (inObserver)
    }
  }

  //····················································································································

}

